  false,\n\t\"url\": null,\n\t\"notes\": \"Unique specimen \"IDNumber\" for over 750
  specimens of Hawaiian grouper (hapu'upu'u, Hyporthodus quernus; family Epinephelidae)
  are included in this dataset.  Each specimen has the following information associated
  with it: standard body length, body weight, and gonad weight metrics, date of collection,
  and both macroscopic & microscopic sexual identities and sexual maturation states
  (the latter based on E. DeMartini's examination of histological slides prepared
  by several outside contractors (Pathology Labs of Queen's Hospital & John Burns
  Medical School).  All specimens were collected by hydraulic handlines from either
  NOAA research vessels or commercial bottomfish boats.\",\n\t\"license_title\": null,\n\t\"extras\":
